import React from 'react';

 const ModalBackdrop = (props)=>{
  const style = {
    'position':'absolute',
    'z-index':100,
    'top':'0',
    'left:':'0',
    'right':'0',
    'bottom':'0',
    'background':'black'
  }

  return(
    <div className = "modal-backdrop" style = {style}>
    </div>
  )
}

export default ModalBackdrop;
